import React from 'react'

class Lista extends React.Component {
  render() {
    const compromissos = ['Estudar', 'Treinar musculação', 'Aerobico']
    const list = (value) => <li>{value}</li>
    return(
      list('Thiago')
    );
  }
}

export default Lista
